import React from 'react';
import './todoDetail.css';

const TodoDetail=(props)=>{
    return (
        <div className="TodoDetail">
            <div className="row">
                <div className="left">
                    Name:
                </div>
                <div className="right">
                    {props.title}
                </div>
            </div>
        </div>
    );
};
export default TodoDetail;
